import React from "react";
import "./styles/focus.css"; // Giữ lại focus.css nếu cần hoặc thay bằng calendar.css
import Profile from "./Profile"; // Đảm bảo bạn đã import Profile

const Calendar = ({ tasks }) => {
  return (
    <div className="home-body-conatiner">
      <header className="search-bar">
        <h1>Calendar</h1>
      </header>
      <main className="body-content">
        <div className="form-section">
          <h2>Default Form</h2>
          <p>Welcome to the universal form!</p>
        </div>
        <div className="profile-section">
          <Profile tasks={tasks} />
        </div>
      </main>
    </div>
  );
};

export default Calendar;
